import React, { useRef, useEffect, useState } from 'react';
import axios from "axios";

const DataLoader = () => {
    const [geom, setGeom] = useState({});
  
    useEffect(() => {
      axios
        .get(
          `https://api-dev-plastico.westeurope.cloudapp.azure.com/v1/geojson/-16.477204736044285/35.276920830563284/22.02712876004935/57.5268216123429?entity_type=trash`
        )
        .then((res) => {
          if (!res.data.features) {
            return
          }
  
          setGeom({
            type: "FeatureCollection",
            features: res.data.features,
          });
        });
    }, []);
  
    return geom;
  };
